import React from 'react';
import Hero from './Hero';

function Home_Page(){
    return(
        <>
            <Hero />
            <div >
            <h1>Get Your Devil & Angel NFT</h1>
            <button>Buy NFT</button>
        </div>
        </>
    )
}

export default Home_Page;
